import styles from './Book6Anim.module.css';
import bookCover6 from '../../assets/img/bookCoverSix';

const Book6 = () => {
    return (
        <div id="card">
            <div class={styles.container}>
                <div class={styles.door6}>
                    <img src={bookCover6} alt=""/>
                </div>
            </div>
            <p>Vacation</p>
        </div>
    );
};

export default Book6;
